import styles from './style.module.css';



interface CategoryButtonProps {
  categoryId: number;
  categoryName: string;
  isActive: boolean;
  onClick: () => void; 
}

export default function CategoryButton({ categoryId, categoryName,onClick}: CategoryButtonProps) {

  const className=styles.categoryButton;

  return (
    <button  onClick={onClick} className={isActive ? `${className} ${styles.active}` : className}>
      {categoryName}
    </button>
  );
}
